import logo from './logo.svg';
import './App.css';

import React, {Component} from "react";
import ReactDOM from "react-dom";
import { HashRouter, Route, Switch, Link } from "react-router-dom";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Media from 'react-bootstrap/Media';
import Accordion from 'react-bootstrap/Accordion';
import Carousel from 'react-bootstrap/Carousel';
import Navbar from 'react-bootstrap/Navbar';
import Image from 'react-bootstrap/Image';
import Dining from "./Components/Dining.jsx"
import Header from "./Components/Header.jsx"
import Homepage from "./Components/Homepage.jsx"
import Example from "./Components/Intro.jsx";
import Booking from "./Components/Bookings.jsx";
import RecreationWellness from "./Components/RecreationWellness.jsx";
import Reviews from "./Components/Reviews.jsx";
import Footer from "./Components/Footer.jsx";
import ResponsiveEmbed from 'react-bootstrap/ResponsiveEmbed';


function App() {
  return (
    <HashRouter basename='/'>
    <Switch>
    <Route exact path= "/" component={testHomepage} />
    <Route path="/dining" component={DiningSection} />
    <Route path="/reviews" component={ ReviewsSection } />
    <Route path="/rec" component={RecreationWellnessSection} />
    <Route path="/booking" component={BookingSection} />
    <Route component={Random404} />
    </Switch>
    </HashRouter>
  );
}

export default App;
